import React from "react";
import "./Sign.css";

const Sign = ({ onBackClick }) => {
  const handleBackClick = () => {
    if (onBackClick) {
      onBackClick(); // Navigate back to the previous page
    }
  };

  return (
    <div className="sign-page">
      {/* Back Button */}
      <button className="back-button" onClick={handleBackClick}>
        <img src="arrow_back.png" alt="Back" />
      </button>

      {/* Orange Triangle */}
      <div className="orange-triangle">
        <img src="taco.png" alt="Orange Triangle" className="taco" />
      </div>

      {/* Pink Ellipse */}
      <div className="pink-ellipse">
        <img src="pinkelip.png" alt="Pink Ellipse" className="pink" />
      </div>

      {/* Sign Form */}
      <div className="sign-container">
        <form>
          <label>Email</label>
          <input type="email" placeholder="Enter your email" />

          <label>Password</label>
          <input type="password" placeholder="********" />

          <label>Confirm Password</label>
          <input type="password" placeholder="********" />

          <button type="submit" className="btn sign-btn">Sign Up</button>
        </form>
        <div className="login-link">
          Already have an account? <a href="/login">Log In</a>
        </div>
      </div>

      {/* Bottom Circle */}
      <div className="bottom-circle">
        <img src="bottomellip.png" alt="Bottom Circle" className="bottom" />
      </div>
    </div>
  );
};

export default Sign;
